// src/components/TradeJournal.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Typography,
  Button,
  TextField,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Paper,
  Grid,
} from '@mui/material';
import { Delete, Edit } from '@mui/icons-material';

const TradeJournal = () => {
  const [trades, setTrades] = useState([]);
  const [newTrade, setNewTrade] = useState({ entry: '', exit: '', profit: '', stopLoss: '' });
  const [editTrade, setEditTrade] = useState(null);

  useEffect(() => {
    const fetchTrades = async () => {
      try {
        const response = await axios.get(`${process.env.REACT_APP_API_URL}/trades`);
        setTrades(response.data);
      } catch (err) {
        console.error('Error fetching trades:', err);
      }
    };

    fetchTrades();
  }, []);

  const handleAddTrade = async () => {
    if (newTrade.entry && newTrade.exit && newTrade.profit && newTrade.stopLoss) {
      try {
        const response = await axios.post(`${process.env.REACT_APP_API_URL}/trades`, newTrade);
        setTrades([...trades, response.data]);
        setNewTrade({ entry: '', exit: '', profit: '', stopLoss: '' });
      } catch (err) {
        console.error('Error adding trade:', err);
      }
    }
  };

  const handleRemoveTrade = async (id) => {
    try {
      await axios.delete(`${process.env.REACT_APP_API_URL}/trades/${id}`);
      setTrades(trades.filter((trade) => trade._id !== id));
    } catch (err) {
      console.error('Error removing trade:', err);
    }
  };

  const handleEditTrade = (trade) => {
    setEditTrade(trade);
    setNewTrade(trade);
  };

  const handleUpdateTrade = async () => {
    if (editTrade) {
      try {
        const response = await axios.put(`${process.env.REACT_APP_API_URL}/trades/${editTrade._id}`, newTrade);
        setTrades(trades.map((trade) => (trade._id === editTrade._id ? response.data : trade)));
        setEditTrade(null);
        setNewTrade({ entry: '', exit: '', profit: '', stopLoss: '' });
      } catch (err) {
        console.error('Error updating trade:', err);
      }
    }
  };

  const handleCancelEdit = () => {
    setEditTrade(null);
    setNewTrade({ entry: '', exit: '', profit: '', stopLoss: '' });
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Trade Journal
      </Typography>
      <Paper elevation={3} style={{ padding: '16px', marginBottom: '16px' }}>
        <Typography variant="h6">{editTrade ? 'Edit Trade' : 'Add New Trade'}</Typography>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Entry Point"
              value={newTrade.entry}
              onChange={(e) => setNewTrade({ ...newTrade, entry: e.target.value })}
              fullWidth
              margin="normal"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Exit Point"
              value={newTrade.exit}
              onChange={(e) => setNewTrade({ ...newTrade, exit: e.target.value })}
              fullWidth
              margin="normal"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Profit"
              value={newTrade.profit}
              onChange={(e) => setNewTrade({ ...newTrade, profit: e.target.value })}
              fullWidth
              margin="normal"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Stop Loss"
              value={newTrade.stopLoss}
              onChange={(e) => setNewTrade({ ...newTrade, stopLoss: e.target.value })}
              fullWidth
              margin="normal"
            />
          </Grid>
        </Grid>
        <Button
          variant="contained"
          color="primary"
          onClick={editTrade ? handleUpdateTrade : handleAddTrade}
          style={{ marginRight: '8px' }}
        >
          {editTrade ? 'Update Trade' : 'Add Trade'}
        </Button>
        {editTrade && (
          <Button variant="outlined" color="secondary" onClick={handleCancelEdit}>
            Cancel
          </Button>
        )}
      </Paper>

      <Typography variant="h6">Logged Trades</Typography>
      <List>
        {trades.map((trade) => (
          <ListItem key={trade._id} divider>
            <ListItemText primary={`Entry: ${trade.entry}, Exit: ${trade.exit}, Profit: ${trade.profit}, Stop Loss: ${trade.stopLoss}`} />
            <IconButton onClick={() => handleEditTrade(trade)}>
              <Edit />
            </IconButton>
            <IconButton onClick={() => handleRemoveTrade(trade._id)}>
              <Delete />
            </IconButton>
          </ListItem>
        ))}
      </List>
    </Container>
  );
};

export default TradeJournal;
